import React from 'react';

export function Project({ name, imgUrl }) {
    return (
        <div>
            <h3>{name}</h3>
            <img src="https://github.githubassets.com/images/modules/logos_page/GitHub-Mark.png" alt="Project Image" />
        </div>
    );
}
